import React, { useState } from 'react';

function CompanyRegister() {
  const [name, setName] = useState('');
  const [industry, setIndustry] = useState('');
  const [size, setSize] = useState('');
  const [email, setEmail] = useState('');
  const [logoFile, setLogoFile] = useState(null);
  const [docFile, setDocFile] = useState(null);
  const [message, setMessage] = useState('');

  const fileToDataUrl = (file) =>
    new Promise((resolve, reject) => {
      const reader = new FileReader();
      reader.onload = () => resolve(reader.result);
      reader.onerror = () => reject('File reading failed');
      reader.readAsDataURL(file);
    });

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!name || !industry || !size || !email) {
      setMessage('Please fill in all required fields.');
      return;
    }

    const logo = logoFile ? await fileToDataUrl(logoFile) : null;
    const document = docFile ? await fileToDataUrl(docFile) : null;

    const newCompany = {
      id: Date.now(),
      name,
      industry,
      size,
      email,
      logo,
      document,
      accepted: false,
      hasNotification: false
    };

    const existingCompanies = JSON.parse(sessionStorage.getItem('companies') || '[]');
    existingCompanies.push(newCompany);
    sessionStorage.setItem('companies', JSON.stringify(existingCompanies));

    setName('');
    setIndustry('');
    setSize('');
    setEmail('');
    setLogoFile(null);
    setDocFile(null);
    setMessage('Company registered successfully!');
  };

  return (
    <div className="register-container" style={{ maxWidth: '600px', margin: 'auto' }}>
      <h2 style={{ textAlign: 'center' }}>Company Registration</h2>
      <form onSubmit={handleSubmit}>
        <div style={{ marginBottom: '10px' }}>
          <label>Company Name:</label>
          <input
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
            style={{ width: '100%' }}
          />
        </div>
        <div style={{ marginBottom: '10px' }}>
          <label>Industry:</label>
          <input
            type="text"
            value={industry}
            onChange={(e) => setIndustry(e.target.value)}
            required
            style={{ width: '100%' }}
          />
        </div>
        <div style={{ marginBottom: '10px' }}>
          <label>Company Size:</label>
          <input
            type="text"
            value={size}
            onChange={(e) => setSize(e.target.value)}
            required
            style={{ width: '100%' }}
          />
        </div>
        <div style={{ marginBottom: '10px' }}>
          <label>Email:</label>
          <input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
            style={{ width: '100%' }}
          />
        </div>
        <div style={{ marginBottom: '10px' }}>
          <label>Company Logo (optional):</label>
          <input
            type="file"
            accept="image/*"
            onChange={(e) => setLogoFile(e.target.files[0])}
          />
        </div>
        <div style={{ marginBottom: '10px' }}>
          <label>Document (optional):</label>
          <input
            type="file"
            onChange={(e) => setDocFile(e.target.files[0])}
          />
        </div>
        <button type="submit" style={{ width: '100%', padding: '10px' }}>
          Register
        </button>
      </form>
      {message && <p style={{ marginTop: '15px', color: 'green' }}>{message}</p>}
    </div>
  );
}

export default CompanyRegister;
